import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../css/BottomNav.css'; // Assegure-se de que o caminho para o CSS está correto

import '../css/Profile.css'; // Certifique-se de que o caminho para o seu CSS está correto

function Profile() {
  // Informações fictícias do usuário, substitua pelos dados reais do seu usuário
  const userInfo = {
    name: "André Pires",
    country: "Portugal",
    joinDate: "Joined 1 year ago",
    correctAnswers: 20,
    wrongAnswers: 2,
    stars: 6,
    dailyRanking: "#1",
    weeklyRanking: "#20",
    globalRanking: "#100",
  };

    const navigate = useNavigate();

    // Função para redirecionar para a página de edição de perfil
    const navigateToEditProfile = () => {
      navigate('/editProfile');
    };



  return (
    <div className="profile-container">
    <header className="profile-header">
        <img src="path-to-user-avatar.jpg" alt="User Avatar" className="user-avatar" />
        <h1>André Pires</h1>
        <button onClick={navigateToEditProfile}>Edit Profile</button>
      </header>
      <div className="user-details">
        <p>{userInfo.country}</p>
        <p>{userInfo.joinDate}</p>
      </div>
      <div className="user-stats">
        <div>Respostas corretas: {userInfo.correctAnswers}</div>
        <div>Respostas erradas: {userInfo.wrongAnswers}</div>
        <div>Stars: {userInfo.stars}</div>
        <div>Classificação diária: {userInfo.dailyRanking}</div>
        <div>Classificação semanal: {userInfo.weeklyRanking}</div>
        <div>Classificação global: {userInfo.globalRanking}</div>
      </div>
    </div>
  );
}

export default Profile;
